// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

/// @title TrustDose - Simple Prescription (Doctor only)
contract Prescription {
    uint256 public constant VALIDITY = 48 hours;

    // list of all doctors
    mapping(address => bool) public isDoctor;

    // counter
    uint256 private _counter;

    // table
    struct PrescriptionData {
        uint256 id;
        bytes32 patientHash;
        string  medicine;
        string  dosage;
        string  frequency;
        string  duration;
        address doctor;
        uint256 createdAt;
        uint256 expiresAt;
    }

    // mapping to store prescriptions
    mapping(uint256 => PrescriptionData) public prescriptions;

    // event
    event PrescriptionCreated(
        uint256 indexed id,
        address indexed doctor,
        bytes32 indexed patientHash,
        string medicine,
        string dosage,
        string frequency,
        string duration,
        uint256 createdAt,
        uint256 expiresAt
    );

    // auth
    constructor(address[] memory _doctors) {
        for (uint256 i = 0; i < _doctors.length; i++) {
            isDoctor[_doctors[i]] = true;
        }
    }

    // create single prescription
    function createPrescription(
        bytes32 patientHash,
        string memory medicine,
        string memory dosage,
        string memory frequency,
        string memory duration
    ) external returns (uint256) {
        require(isDoctor[msg.sender], "Only doctor");
        require(patientHash != bytes32(0), "Invalid patientHash");

        _counter++;
        uint256 created = block.timestamp;
        uint256 expires = created + VALIDITY;

        prescriptions[_counter] = PrescriptionData({
            id: _counter,
            patientHash: patientHash,
            medicine: medicine,
            dosage: dosage,
            frequency: frequency,
            duration: duration,
            doctor: msg.sender,
            createdAt: created,
            expiresAt: expires
        });

        emit PrescriptionCreated(
            _counter,
            msg.sender,
            patientHash,
            medicine,
            dosage,
            frequency,
            duration,
            created,
            expires
        );

        return _counter;
    }

    function createMultiplePrescriptions(
        bytes32 patientHash,
        string[] memory medicines,
        string[] memory dosages,
        string[] memory frequencies,
        string[] memory durations
    ) external returns (uint256[] memory ids) {
        require(isDoctor[msg.sender], "Only doctor");
        require(patientHash != bytes32(0), "Invalid patientHash");

        uint256 n = medicines.length;
        require(n > 0, "Empty prescriptions");
        require(
            dosages.length == n &&
            frequencies.length == n &&
            durations.length == n,
            "Length mismatch"
        );

        ids = new uint256[](n);

        // same timestamps for whole batch (same tx)
        uint256 created = block.timestamp;
        uint256 expires = created + VALIDITY;

        for (uint256 i = 0; i < n; i++) {
            _counter++;

            prescriptions[_counter] = PrescriptionData({
                id: _counter,
                patientHash: patientHash,
                medicine: medicines[i],
                dosage: dosages[i],
                frequency: frequencies[i],
                duration: durations[i],
                doctor: msg.sender,
                createdAt: created,
                expiresAt: expires
            });

            emit PrescriptionCreated(
                _counter,
                msg.sender,
                patientHash,
                medicines[i],
                dosages[i],
                frequencies[i],
                durations[i],
                created,
                expires
            );

            ids[i] = _counter;
        }

        return ids;
    }

    function getPrescription(uint256 id)
        external
        view
        returns (
            bytes32 patientHash,
            string memory medicine,
            string memory dosage,
            string memory frequency,
            string memory duration,
            address doctor,
            uint256 createdAt,
            uint256 expiresAt
        )
    {
        require(_exists(id), "Invalid ID");
        PrescriptionData storage p = prescriptions[id];
        return (
            p.patientHash,
            p.medicine,
            p.dosage,
            p.frequency,
            p.duration,
            p.doctor,
            p.createdAt,
            p.expiresAt
        );
    }

    function isValid(uint256 id) public view returns (bool) {
        if (!_exists(id)) return false;
        PrescriptionData memory p = prescriptions[id];
        return block.timestamp <= p.expiresAt;
    }

    function _exists(uint256 id) internal view returns (bool) {
        return id > 0 && id <= _counter;
    }
}
